import React from 'react';

export default function AdminHome() {
  const handleLogout = () => {
    window.location.href = '/login';
  };

  const handleExpertRegistration = () => {
    window.location.href = '/src/Components/expertRegistartion.js';
  };

  return (
    <div>
      <h1>Welcome Admin</h1>
      <button onClick={handleLogout}>Logout</button>
      <button onClick={handleExpertRegistration}>Expert Registration</button>
    </div>
  );
}
